import React from "react";
import logo from "./logo.svg";
import "./App.css";
import UserInput from "./Components/UserInput";
import UserOutput from "./Components/UserOutput";

function App() {
	return (
		<div>
			<h1>Username</h1>
			<UserInput></UserInput>
			<h1>Password</h1>
			<UserInput></UserInput>
			<h1>Entered Username</h1>
			<UserOutput value="output1"></UserOutput>
			<h1>Entered Password</h1>
			<UserOutput value="output2"></UserOutput>
		</div>
	);
}

export default App;
